import React from 'react'
import { Link } from 'react-router-dom';
function SidePannelButtons() {
    return (
        <li key={this.props.index} className={this.props.item.cName}>
                  <Link to={this.props.item.path}>
                    {this.props.item.icon}
                    <span>{this.props.item.title}</span>
                  </Link>
                  <ul>
                      {this.props.item.children.map((child,index)=>{
                          return(
                              <SidePannelButtons item={child} index={index}/>
                          )
                      })}
                  </ul>
        </li>
    )
}

export default SidePannelButtons
